const stateDefault = {
    tenDangNhap: ''
}



export const NguoiDungReducer = (state = stateDefault, action) => {

    switch (action.type) {

        case 'XU_LY_DANG_NHAP_THANH_CONG': {
            state.tenDangNhap = action.tenDangNhap;
            return { ...state }
        }

        default: return { ...state }
    }
}
